   console.log(props.isLogged)
    useEffect(()=>{
        isLoggedView();
    },[props.isLogged])


    const isLoggedView = () =>{
        if (props.isLogged===true){
        return(
            <div>
                <Nav/>
            </div>
        )
    }
    return(
            <div>
                <Login username={props.username} setUsername={props.setUsername} setIsLogged={props.setIsLogged}/>
            </div>
        )
    }

    return(
        <div>
            {isLoggedView()}
        </div>
    )
}

